const CryptJS = require('crypto-js')


desdata = function(data) {
    j = "DXZWdxUZ5jgsUFPF"
    z = CryptJS.enc.Utf8.parse(j)
    var e = CryptJS.AES.decrypt(data, z, {
        iv: CryptJS.enc.Utf8.parse(j.substr(0, 16)),
        mode: CryptJS.mode.ECB,
        padding: CryptJS.pad.Pkcs7
    });
    return JSON.parse(e.toString(CryptJS.enc.Utf8))
}
data = ''
console.log(desdata(data))